برنامج أوقات الصلاة  يتيح لك معرفة  أوقات الصلاة في كل مكان وأي وقت تحتاجه لاأداء هذا الركن الأساسي عن طريق تحديد أوقات الصلاة تلقائيا بناء على البلد.
ويحتوي التطبيق أيضا على إشعارات الأذان حيث يمكنك التمتع بعشر أصوات مختلفة من الأذان كما يخبرك أيضاً البرنامج لاتجاه القبلة عن طريق البوصلة المضمنة في البرنامج

قال تعالى - :{ فَإِذا قَضَيْتُمُ الصَّلاةَ فَاذْكُرُوا اللَّهَ قِياماً وَقُعُوداً وَعَلى جُنُوبِكُمْ فَإِذَا اطْمَأْنَنْتُمْ فَأَقِيمُوا الصَّلاةَ إِنَّ الصَّلاةَ كانَتْ عَلَى الْمُؤْمِنِينَ كِتاباً مَوْقُوتاً}
